import React from 'react';
import logo from './logo.svg';
import './App.css';
import Checkout from './Checkout'
import Success from './Success'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
   <div>
     <Checkout/>
     <Router>
     <Route exact path="/success" component={Success} />
       </Router>
    </div>
  );
}

export default App;
